import {  Layout,Menu } from 'antd';
import { DashboardOutlined, UserOutlined } from '@ant-design/icons';

import User from '../User/User'

import 'antd/dist/antd.css';
import './styles.css'


const Main = () => {
    const { Header, Content, Sider } = Layout;

    const handleClick = e => {
        console.log('click ', e);
    };
    return ( 
        <div>
            <Layout style={{ height: '100vh', overflow:'hidden'}}>
                <Sider width={200} className="sider" >
                    <div className="logo">
                        LOGO
                    </div>
                    <Menu
                        onClick={handleClick}
                        style={{ height: '100%', borderRight: 0, backgroundColor:'grey', color:'white'}}                        defaultSelectedKeys={['1']}
                        defaultOpenKeys={['sub1']}
                        mode="inline"
                    >
                        <Menu.Item key="1" icon={<DashboardOutlined />}>Overview</Menu.Item>
                        <Menu.Item key="3" icon={<UserOutlined />}>Users</Menu.Item>   
                    </Menu>
                </Sider>
                <Layout>
                    <Header className="header">
                        Header
                    </Header>
                    <Content className="content" style={{overflow:'scroll', fontSize:'150px'}}>
                        <User />
                    </Content>
                </Layout>
            </Layout>
        </div>
     );
}

export default Main;
